import React from "react";
import { Box, Typography, Divider, List, ListItem, ListItemText } from "@mui/material";
import Header from "../components/header";

const CustodianCertificate = () => {
  return (
    <Box
      maxWidth="md"
      mx="auto"
      p={5}
      border="1px solid #ccc"
      bgcolor="white"
      color="black"
      boxShadow={3}
      minHeight="100vh"
    >
      <Header />

      <Box display="flex" justifyContent="space-between" my={2}>
        <Typography variant="body2" fontWeight="500" sx={{ textDecoration: "underline" }}>
          File No. AC1/28596/2020/MD(Anaes)
        </Typography>
        <Typography variant="body2" fontWeight="500" sx={{ textDecoration: "underline" }}>
          Date: 07.07.2025
        </Typography>
      </Box>

      <Typography
        variant="h6"
        align="center"
        fontWeight="bold"
        sx={{ textDecoration: "underline", my: 3 }}
      >
        CUSTODIAN CERTIFICATE
      </Typography>

      <Typography textAlign="justify" mb={2}>
        This is to certify that <strong>Dr.Mohamed Etherish M</strong>, MD (Anaesthesiology)
        Student ID No. 28596 is a Bonafide student of this Institute from 30.05.2020 to 29.05.2023.
        <br />
        The following certificates are retained in this Institute:
      </Typography>

      <List sx={{ listStyleType: "decimal", pl: 4 }} dense>
        {[
          "Memorandum of Mark Memos of MBBS (4 Nos.)",
          "Compulsory Rotation Internship Certificate MBBS",
          "MBBS Degree Certificate",
          "Medical Registration Certificate of MBBS",
          "Course cum Conduct certificate of MBBS",
          "Transfer and Migration Certificates of MBBS-2 Nos.",
          "X class Memorandum of Marks",
          "Intermediate Memorandum of Marks",
          "Community Certificate",
        ].map((text, index) => (
          <ListItem key={index} sx={{ display: "list-item", py: 0 }}>
            <ListItemText primary={text} />
          </ListItem>
        ))}
      </List>

      <Typography textAlign="justify" mt={3}>
        His date of birth as per SSC certificate is 27-07-1992 (
        <em>Twenty seven July one nine nine two</em>).
        <br />
        This certificate is issued for the purpose to appear for upcoming INI-Super Speciality and
        DNB examinations.
      </Typography>

      <Box mt={8} textAlign="right">
        <Typography variant="subtitle1" fontWeight="bold">
          DEAN
        </Typography>
      </Box>
    </Box>
  );
};

export default CustodianCertificate;
